ative and expectorant.||In the Antilles and Western Africa, fruit pulp macerated in water is considered depurative, cooling and febrifuge, and applied to burns and headaches.||In West Africa, fruit roasted in ashes is purgative and diuretic.||In Sumatra, bark decoction used to clean wounds and pounded leaves used as poultice for headaches.||Internally, leaves used as diuretic.||Throughout the Caribbean, used as analgesic and anti-inflammatory||In the Antilles, fresh tops and leaves are ground and used as topicals for wounds and as cicatrizant.||In Venezuela, decoction of bark used for diarrhea. Also, used to treat hematomas and tumors.||In Costa Rica, used as purgative.||In Cote-d'Ivoire, used for hypertension because of its diuretic effect.||In Columbia, used for respiratory afflictions.||In Vietnam, used as expectorant, antitussive, laxative and stomachic. Fruit decoction used to treat diarrhea, stomachaches, cold, bronchitis, cough, asthma, and urethritis.||In Haiti, the fruit of Crescentia cujete is part of the herbal mixtures reported in its traditional medicine. In the province of Camaguey in Cuba, is considered a panacea.||In Panama, where it is called totumo, the fruit is used for diarrhea and stomachaches. Also for respiratory ailments, bronchitis, cough, colds, toothaches. headaches, menstrual irregularities; as laxative, antiinflammatory, febrifuge. The leaves are used for hypertension.','calabashweed.xml')" in D:\xampp\htdocs\herbal\fuel\core\classes\database\pdo\connection.php on line 237
