morrhages from the genitalia and air passages.||In China, juice of roots used as antifebrile and restorative.||Juice of the trunk applied to scalp to increase hair growth and prevent hair from falling.||In West Africa, used for diarrhea.||In Gambia, sap of inflorescence used for earaches.||In French Guiana, flowers used as emmenagogue.||In the Gold Coast, sap from roots given as enema for diarrhea.||In Cambodia, Java and Malaya, juice from trunk used for dysentery and diarrhea.||Juice from flowers, mixed with curds, for dysmenorrhea and menorrhagia.||Flour made of green bananas used for dyspepsia with flatulence and acidity.||Ripe fruit, mixed with half its weight in tamarinds and a little salt, is a valuable food in chronic dysentery and diarrhea.||Cooked flower used for diabetes. Flowers also used as cardialgic.||Sap of the flower used for earaches.||In Western Ghat in India, leaves are used for bandaging cuts, blisters and ulcers.||Ripe bananas combined with tamarind and common salt used for dysentery.||In traditional medicine in India, used for diabetes.||In South-Western Nigeria, green fruits used for diabetes.','banana.xml')" in D:\xampp\htdocs\herbal\fuel\core\classes\database\pdo\connection.php on line 237
